  }

  state = {
    name: this.props.name,
    email: this.props.email,
    created_on: this.props.created_on
  };

  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="col-12"></div>
        </div>
      </div>
    );
  }
}

export default Admin;
